	add("ampersand", "{\"term\":\"ampersand\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Image:Ampersand.svg|thumb|right|The \u0026quot;Roman\u0026quot; ampersand on the left is stylised, but the \u0026quot;italic\u0026quot; one on the right is clearly similar to \u0026quot;et\u0026quot;.A mondegreen of \u0026quot;and \u0027per se\u0027 and\u0026quot;, meaning \u0026quot;and (the character) \u0027\u0026amp;\u0027 by itself\u0026quot;, which is how the symbol (\u0027\u0027\u0026amp;\u0027\u0027) was originally referred to in English. This formulation is due to the fact that in schools, when reciting the alphabet, any letter that could also be used as a word in itself (\u0026quot;A,\u0026quot; \u0026quot;I,\u0026quot; \u0026quot;O\u0026quot; and, at one point, \u0026quot;\u0026amp;\u0026quot;) was preceded by the Latin expression \u0027per se\u0027 (Latin for \u0026quot;by itself\u0026quot;). Also, it was common practice to add at the end of the alphabet the \u0026quot;\u0026amp;\u0026quot; sign, pronounced \u0026quot;and\u0026quot;. Thus the end of the recitation would be: \u0026quot;X, Y, Z and per se and.\u0026quot; This last phrase was routinely slurred to \u0026quot;ampersand\u0026quot; and the term crept into common English usage by around 1837.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The symbol \u0026quot;\u0026amp;\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027ampersand\u0027\u0027 character in many logics acts as an operator connecting two propositions\", \"priority\":2}]}, \"synonyms\":{}}");

